  extends React.HTMLProps<HTMLDivElement>,
    TopProps,
    LeftProps,
    BottomProps,
    RightProps,
    SpaceProps {
  font?: FontName
  name: IconName
  fontSize?: string
  style?: any
  onClick?: () => void
}

