  color: _color,
  font,
  fontSize,
  name,
  ...props
}) => <div {...props}>{icons[name]}</div>

export default styled(Icon)`
  font-family: ${props => props.font || "artsy-icons"};
  color: ${props => props.color || "purple"};
  font-size: ${props => props.fontSize || "24px"};
  margin: 0 5px;
  display: inline-block;
  letter-spacing: 0;
  position: relative;
  ${bottom};
  ${color};
  ${left};
  ${right};
  ${space};
  ${top};
`
